    void LoadModelAgainIfDataExists(RegistrationViewModel registrationModel)
    {
        //IsFormSubmit = true;
        model = registrationModel;
        model.Year = DateTime.Now.Year.ToString();
        //await this.CheckPaymentStatus(model.RefNo);

        if (ShowOptions == "B_Ed")
        {
            IsM_Ed = false;
            HeadingText = "B.Ed";
            model.CourseName = "Bachelor of Education";
            model.IsKumaunUniversity = registrationModel.IsKumaunUniversity;
            if (model.IsKumaunUniversity == "Yes")
            {
                PassingYearList = GetPassingYears("Yes");
            }
            else if (model.IsKumaunUniversity == "No")
            {
                PassingYearList = GetPassingYears("No");
            }

            if (model.IsPhysicallyChallenged == "No")
            {
                IsPhysically = true;
                PhysicallyChallengesTypeList = PHTypeListOnlyNone();
                model.PhysicallyChallengedType = "None";
            }
            else
            {
                IsPhysically = false;
                PhysicallyChallengesTypeList = PHTypeListWithOutNone();
            }

            if (model.IsDomicileOfUttarakhand == "Yes")
            {
                CategoryList = CastCategoryWithoutUG();
                model.Category = registrationModel.Category;
                IsStateEnabled = true;
            }
            else
            {
                CategoryList = CastCategoryWithUG();
                model.Category = "Unreserved General";
                IsStateEnabled = false;
            }

            if (model.Category != "Unreserved General")
            {
                IsEwsHideShow = false;
                model.Category = "Schedule Cast (SC)";
            }
            else
            {
                IsEwsHideShow = true;
                model.Category = "Unreserved General";
            }

            if (model.GradutionPassingYear == "Appearing")
            {
                HidePostGraduation = false;
            }
        }
        else
        {
            model.CourseName = "Master of Education";
            IsM_Ed = true;
            HeadingText = "M.Ed";
            //PassingYearList.Remove("Appearing");
            if (registrationModel.IsAppearing)
            {
                model.IsAppearing = registrationModel.IsAppearing;
                isChecked = registrationModel.IsAppearing;
                ShowKUOptions = true;
                model.IsKumaunUniversity = registrationModel.IsKumaunUniversity;
                PassingYearList = GetPassingYears("Yes");
                M_EdExamMarksRealonly = true;
            }

            if (model.IsPhysicallyChallenged == "No")
            {
                IsPhysically = true;
                PhysicallyChallengesTypeList = PHTypeListOnlyNone();
                model.PhysicallyChallengedType = "None";
            }
            else
            {
                IsPhysically = false;
                PhysicallyChallengesTypeList = PHTypeListWithOutNone();
            }

            if (model.IsDomicileOfUttarakhand == "Yes")
            {
                CategoryList = CastCategoryWithUG();
                model.Category = "Unreserved General";
                IsStateEnabled = true;
            }
            else
            {
                CategoryList = CastCategoryWithoutUG();
                model.Category = "Schedule Cast (SC)";
                IsStateEnabled = false;
            }

            if (model.Category != "Unreserved General")
            {
                IsEwsHideShow = false;
                model.Category = "Schedule Cast (SC)";
            }
            else
            {
                IsEwsHideShow = true;
                model.Category = "Unreserved General";
            }
        }
    }


