                                            CssClass = "e-toast-danger",
                                            Icon = "e-error toast-icons"
                                        });
                                        await Js.CloseModel("modalConfirmDelete");
                                    }
                                }
                                else
                                {
                                    UpdateLoader = "none";
                                }
                            }
                            else
                            {
                                UpdateLoader = "none";
                            }
